import React from "react";
import Collection from "./BotList";

function BotsCollection({bots}) {
  let botsList = bots.map((item)=> {
    return <Collection
    key={item.id} 
    name={item.name}
    health ={item.health}
    damage={item.damage}
    armor={item.armor}
    bot_class={item.bot_class}
    catchphrase={item.catchphrase}
    avatar_url={item.avatar_url}
    created_at={item.created_at}
    updated_at ={item.updated_at}
    />;
  })
  return (
   <div>
           <div className='col-3 p-2'>
    <div className="card h-100">
  <img src="" className="card-img-top" alt="News Item"></img>
  <div className="card-body">
    <h3 className="card-title">{"News On The Go"}</h3>

  </div>
</div>
</div>
        {botsList}
        </div>

  );
}

export default BotsCollection;
